import React,{useState} from 'react'
export default function Add({onSubmit})
{
    // const {value}=props;
    const [addValue,setAddValue]=useState('')
    function handleChange(e){
        setAddValue(e.target.value)
        // console.log(e.target.value)
    }
    function handleSub(e){
        e.preventDefault();
        console.log(e.target.value)
        onSubmit && typeof onSubmit === 'function' && onSubmit(e.target.value)
    }
    return(
        <form className="mt-3 mb-3" onSubmit={handleSub}>
            <input style={{width:'100%'}} type="text" value={addValue} onChange={handleChange}/>
        </form>
    )
}
